＜メイク落とし＋洗顔＞　豊かに泡立つミクロ泡が、落ちにくいメイクや毛穴の奥の汚れまで１度でしっかり落とします。素顔のときの洗顔料としてもお使いいただけます。＊旅行やトライアルユースに便利なミニサイズ。<br><br><br>ソフティモ スーパークレンジングウォッシュ(Wヒアルロン酸) 60g<br>植物生まれの洗浄成分配合、豊かなミクロ泡でしっかり落とすクレンジングフォームです。<br>●細かな泡が、落ちにくいメイクや毛穴の汚れまで、1度でしっかり落とします。<br>●うるおいを「あたえる」「保護する」2種類のヒアルロン酸を配合。うるおい感に満ちた、みずみずしい素肌に導きます。<br>●素顔の時の洗顔料としてもお使いいただけます。<br>●W洗顔不要。<br>●無香料・無着色。<br> 使用方法：手のひらに適量(約2cm)をとり、水かぬるま湯でよく泡立ててから洗顔し、そのあと充分にすすいでください。 使用上の注意ご使用後は、キャップをきちんとしめてください。 <br>ご注意：●傷やはれもの・湿しん等、お肌に異常のあるときはお使いにならないでください。<br>●使用中、赤み・はれ・かゆみ・刺激等の異常があらわれた場合は、使用を中止し、皮膚科専門医等へご相談ください。そのまま使用を続けますと症状が悪化することがあります。<br>●目に入った時は、すぐに洗い流してください。<br>●乳幼児の手の届かないところに保管してください。 配合成分水、ミリスチン酸、グリセリン、ステアリン酸、水酸化K、ラウリン酸、PEG-32、PEG-6、ラウレス-7、アセチルヒアルロン酸Na、ヒアルロン酸Na、BG、ココイルグリシンK、ココイルメチルタウリンNa、ジステアリン酸グリコール、ステアリン酸グリセリル、ヒドロキシプロピルメチルセルロース、ラウレス-4酢酸Na、ラウロイルグルタミン酸Na、メチルパラベン <br>原産国：日本<br><br> お問い合わせ先：コーセーコスメポート株式会社でんわ：03-3277-8551  <br>販売_製造元： コーセーコスメポート<br>ブランド：ソフティモ<br>JAN：4971710319538<br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
